import React, { useState } from 'react'
import { Link } from 'react-router-dom'
import "./menu.css"
function Menu({set}) {
    const [cart,setCart]=useState("")
    const design={
        color:"white",
        textDecoration:"none"
    }
    const show=()=>{
     set(true)
    }
    const hide=()=>{
        set(false)
    }
  return (
    <div className='navmenu' onMouseEnter={show} onMouseLeave={hide}>
        <ul>
        <li onClick={()=>setCart("shooter")}><Link to="/" style={design}>Shooter</Link></li>
        <li onClick={()=>setCart("shooter")}><Link to="/" style={design}>Thid-Person</Link></li>
        <li onClick={()=>setCart("shooter")}><Link to="/" style={design}>Zombie</Link></li>
        <li onClick={()=>setCart("shooter")}><Link to="/" style={design}>3d</Link></li>
        <li onClick={()=>setCart("shooter")}><Link to="/" style={design}>2d</Link></li>
        <li onClick={()=>setCart("shooter")}><Link to="/" style={design}>Anime</Link></li>
        <li onClick={()=>setCart("shooter")}><Link to="/" style={design}>Sci-fi</Link></li>
        <li onClick={()=>setCart("shooter")}><Link to="/" style={design}>Sandbox</Link></li>
        <li onClick={()=>setCart("shooter")}><Link to="/" style={design}>Sport</Link></li>
        <li><Link to="/" style={design}>Superhero</Link></li>
        <li><Link to="/" style={design}>Martial-arts</Link></li>
        </ul>
        </div>
  )
}

export default Menu
